import React from 'react'

export default function GameOver(props) {
  if (props.show) {
    return (
      <div id="gameover">
        {props.winner == 0 ? <h1>Fim de jogo! O jogador 1 ganhou</h1> : <h1>Fim de jogo! O jogador 2 ganhou</h1>}
        
        <button>Jogar novamente</button>
      </div>
    )
  }
}
